pragma solidity ^0.8.14;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract CookieCapital is ERC20 {

    address public _stakedTokenAddress;
    uint public _totalCookiesEaten;

    mapping (address => uint) public _staked;
    mapping (address => uint) public _cookiePower;
    mapping (address => uint) public _lastStaked;

    ERC20 private _token;

    event Staked(address indexed user, uint256 amount);
    event Unstaked(address indexed user, uint256 amount);
    event Harvest(address indexed user, uint256 amount);
    event EatCookies(address indexed user, uint256 amount);

    constructor (address stakedTokenAddress) ERC20("Cookies", "COK") {
        _stakedTokenAddress = stakedTokenAddress;
        _token = ERC20(stakedTokenAddress);
    }

    function stake(uint256 amount) public {
        require(amount > 0, "You need to stake more than 0 tokens");
        if (_staked[msg.sender] > 0) {
            unstake();
        }
        _token.transferFrom(msg.sender, address(this), amount);
        _staked[msg.sender] = amount;
        _lastStaked[msg.sender] = block.timestamp;
        emit Staked(msg.sender, amount);
    }

    function unstake() public {
        require(_staked[msg.sender] > 0, "You haven't staked anything");
        harvest();
        uint256 staked = _staked[msg.sender];
        _staked[msg.sender] = 0;
        _token.transfer(msg.sender, staked);
        emit Unstaked(msg.sender, staked);
    }

    function harvest() public {
        require(_staked[msg.sender] > 0, "You haven't staked anything");
        uint256 hoursSpent = ((block.timestamp - _lastStaked[msg.sender]) * 1000) / 3600;
        uint256 cookieMultiplier = 1000 + _cookiePower[msg.sender];
        uint256 earnedCookies = (_staked[msg.sender] * hoursSpent * cookieMultiplier) / 1000;
        _lastStaked[msg.sender] = block.timestamp;
        _mint(msg.sender, earnedCookies);
        emit Harvest(msg.sender, earnedCookies);
    }

    function eatCookies(uint256 amount) public {
        require(amount >= (100 * 10*18), "Must eat at least 100 cookies");
        require(balanceOf(msg.sender) >= amount, "Not enough Cookies");
        _burn(msg.sender, amount);
        _cookiePower[msg.sender] += amount / (100 * 10*18);
        emit EatCookies(msg.sender, amount);
    }
}
